/* styles.css */

.outcome {
  font-weight: bold;
  color: white;
  padding: 5px 10px;
  border-radius: 5px;
  text-align: center;
  display: inline-block;
  min-width: 140px; /* Match the widest label */
}

.approve {
  background-color: #28a745;
}

.reject {
  background-color: #dc3545;
}

.request-change {
  background-color: #f0ad4e;
}

table {
  border-collapse: collapse;
  width: 100%;
}

table, th, td {
  border: 1px solid #000;
  padding: 8px;
}

th {
  background-color: #ffd700;
}

.hideCTRL{
    display: none;
}
